import React, {createRef} from 'react'
import Link from 'next/link'
import { Nav } from 'reactstrap'
import { routes } from '../dashboardRoutes'

export const SideBar = () => {

    const sidebar = createRef()
    return (
        <div
        className="sidebar"
        data-color='red'
        data-active-color="white"

      >
        <div  style={{color:'black',borderBottom:'1px solid black',minHeight:"40px"}}>

          <a
            href="#"
            className="simple-text logo-normal"
            style={{color:'black',borderBottom:'1px solid black'}}
          >
            Dashboard
          </a>
        </div>
        <div className="sidebar-wrapper" ref={sidebar} style={{color:'black',borderTop:'1px solid black'}} >
          <Nav>
            {routes.map((prop, key) => {
              return (
                <li
                //   className={
                //     this.activeRoute(prop.path) +
                //     (prop.pro ? " active-pro" : "")
                //   }
                  key={key}
                >
                  <Link
                   href={prop.path}


                  >
                      <div 
                      className="nav-link" 
                      style ={{display:'flex',alignItems:'center',justifyContent:'center'}}
                      >

                    {/* <i className={prop.icon} /> */}
                    <p style={{color:'#eee'}}>{prop.name}</p>
                      </div>
                  </Link>
                </li>
              );
            })}
          </Nav>
        </div>
      </div>
    )
}
